var thingsInNetwork = Networks[networkName].GetNetworkConnections({ maxDepth: 10 });

for (var i = 0; i < thingsInNetwork.rows.length; i++) {
    var row = thingsInNetwork.rows[i];
    var thing = Things[row.to];
    if (!thing || !thing.ImplementsShape({ thingShapeName: "SvgEnabledThingShape"})) {
           continue;
    }

    result.AddRow({
       thingName: row.to,
        parentThingName: row.from,
        overrides: thing.GetSvgOverrides()
    });
}

